#include <iostream>
#include <vector>
#include <sstream>
using namespace std;

class Solution {
public:
    int evalRPN(vector<string>& tokens) {
        stringstream ss;
        vector<int> stack;
        int num, a, b;
        for (int i = 0; i < tokens.size(); i++) {
            if (tokens[i].compare("+") == 0) {
                b = stack.back();
                stack.pop_back();
                a = stack.back();
                stack.pop_back();
                stack.push_back(a + b);
            } else if (tokens[i].compare("-") == 0) {
                b = stack.back();
                stack.pop_back();
                a = stack.back();
                stack.pop_back();
                stack.push_back(a - b);
            } else if (tokens[i].compare("*") == 0) {
                b = stack.back();
                stack.pop_back();
                a = stack.back();
                stack.pop_back();
                stack.push_back(a * b);
            } else if (tokens[i].compare("/") == 0) {
                b = stack.back();
                stack.pop_back();
                a = stack.back();
                stack.pop_back();
                stack.push_back(a / b);
            } else {
                ss.clear();
                ss << tokens[i];
                ss >> num;
                stack.push_back(num);
            }
        }
        return stack.back();
    }
};

